import { Text, Button, IButtonProps, useTheme } from 'native-base';

type Props = IButtonProps & {
    tittle: string,
    isActive?: boolean,
    type: 'open' | 'closed',
}

export function Filter({
    tittle,
    isActive = false,
    type,
    ...rest
}: Props) {
  return (
    <Button
        variant='outline'
    >
        {tittle}
    </Button>
  );
}
